                        <td>
                          {emp.status === 'active' ? 
                            <Badge bg="success">Aktif</Badge> : 
                            <Badge bg="secondary">{emp.status}</Badge>
                          }
                        </td>
                        <td>
                          <Button 
                            size="sm" 
                            variant="outline-primary"
                            onClick={() => handleEmployeeClick(emp)}
                          >
                            Detail
                          </Button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </Table>
              </Card.Body>
            </Card>
          </Tab.Pane>
        </Tab.Content>
      </Tab.Container>

      {/* Employee Detail Modal dengan Data Mining Analysis */}
      <Modal show={showEmployeeModal} onHide={() => setShowEmployeeModal(false)} size="xl">
        <Modal.Header closeButton style={{ backgroundColor: '#007bff', color: 'white' }}>
          <Modal.Title>🔍 Detail Analisis Karyawan - Data Mining</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {loadingDetail ? (
            <div className="text-center py-4">
              <Spinner animation="border" variant="primary" />
              <p className="mt-2">Menganalisis data karyawan...</p>
            </div>
          ) : employeeDetail ? (
            <div>
              {/* Employee Basic Info */}
              <Row className="mb-4">
                <Col md={6}>
                  <Card className="h-100">
                    <Card.Header style={{ backgroundColor: '#e3f2fd' }}>
                      <h6 className="mb-0">👤 Informasi Dasar</h6>
                    </Card.Header>
                    <Card.Body>
                      <p><strong>Nama:</strong> {employeeDetail.employee.name}</p>
                      <p><strong>Posisi:</strong> {employeeDetail.employee.role}</p>
                      <p><strong>Divisi:</strong> {employeeDetail.employee.division_name}</p>
                      <p><strong>Join Date:</strong> {new Date(employeeDetail.employee.join_date).toLocaleDateString('id-ID')}</p>
                      <p><strong>Tenure:</strong> {employeeDetail.employee.tenure_months} bulan</p>
                    </Card.Body>
                  </Card>
                </Col>
                <Col md={6}>
                  <Card className="h-100">
                    <Card.Header style={{ backgroundColor: '#e3f2fd' }}>
                      <h6 className="mb-0">🎓 Pendidikan</h6>
                    </Card.Header>
                    <Card.Body>
                      <p><strong>Jurusan:</strong> {employeeDetail.employee.major}</p>
                      <p><strong>Tingkat:</strong> {employeeDetail.employee.education_level}</p>
                      <p><strong>Match Score:</strong> 
                        <Badge bg={employeeDetail.education_match_analysis.percentage >= 70 ? 'success' : 
                                  employeeDetail.education_match_analysis.percentage >= 50 ? 'info' : 
                                  employeeDetail.education_match_analysis.percentage >= 30 ? 'warning' : 'danger'}
                               className="ms-2">
                          {employeeDetail.education_match_analysis.percentage}%
                        </Badge>
                      </p>
                      <p><strong>Kategori:</strong> {employeeDetail.education_match_analysis.category}</p>
                    </Card.Body>
                  </Card>
                </Col>
              </Row>

              {/* Data Mining Analysis */}
              <Row className="mb-4">
                <Col md={8}>
                  <Card>
                    <Card.Header style={{ backgroundColor: '#007bff', color: 'white' }}>
                      <h6 className="mb-0">🤖 Analisis Data Mining</h6>
                    </Card.Header>
                    <Card.Body>
                      <Row>
                        <Col md={6}>
                          <h6>Rekomendasi Kontrak:</h6>
                          <div className="p-3 border rounded mb-3" style={{ backgroundColor: '#f8f9fa' }}>
                            <div className="d-flex justify-content-between align-items-center">
                              <span><strong>Durasi:</strong></span>
                              <Badge bg="primary" className="fs-6">
                                {employeeDetail.contract_recommendation.recommended_duration} bulan
                              </Badge>
                            </div>
                            <div className="d-flex justify-content-between align-items-center mt-2">
                              <span><strong>Success Probability:</strong></span>
                              <Badge bg={employeeDetail.contract_recommendation.success_probability >= 70 ? 'success' : 
                                        employeeDetail.contract_recommendation.success_probability >= 50 ? 'warning' : 'danger'}>
                                {employeeDetail.contract_recommendation.success_probability}%
                              </Badge>
                            </div>
                            <div className="d-flex justify-content-between align-items-center mt-2">
                              <span><strong>Risk Level:</strong></span>
                              {getRiskLevelBadge(employeeDetail.contract_recommendation.risk_level)}
                            </div>
                            <div className="d-flex justify-content-between align-items-center mt-2">
                              <span><strong>Confidence:</strong></span>
                              <Badge bg="info">{employeeDetail.contract_recommendation.confidence_level}</Badge>
                            </div>
                          </div>
                        </Col>
                        <Col md={6}>
                          <h6>Profil Serupa Analysis:</h6>
                          <div className="p-3 border rounded" style={{ backgroundColor: '#f8f9fa' }}>
                            <p><strong>Sample Size:</strong> {employeeDetail.similar_profiles_analysis.total_count} karyawan</p>
                            <p><strong>Success Rate:</strong> 
                              <Badge bg="info" className="ms-2">
                                {((employeeDetail.similar_profiles_analysis.active_count / employeeDetail.similar_profiles_analysis.total_count) * 100).toFixed(1)}%
                              </Badge>
                            </p>
                            <p><strong>Avg Duration:</strong> {employeeDetail.similar_profiles_analysis.avg_duration?.toFixed(1)} bulan</p>
                            <p><strong>Resigned:</strong> {employeeDetail.similar_profiles_analysis.resigned_count}</p>
                          </div>
                        </Col>
                      </Row>
                    </Card.Body>
                  </Card>
                </Col>
                <Col md={4}>
                  <Card className="h-100">
                    <Card.Header style={{ backgroundColor: '#28a745', color: 'white' }}>
                      <h6 className="mb-0">�� Data Confidence</h6>
                    </Card.Header>
                    <Card.Body>
                      <div className="text-center">
                        <div className="display-6 mb-3">
                          {employeeDetail.contract_recommendation.data_insights.data_confidence === 'High' ? '🟢' :
                           employeeDetail.contract_recommendation.data_insights.data_confidence === 'Medium' ? '🟡' : '🔴'}
                        </div>
                        <h5>{employeeDetail.contract_recommendation.data_insights.data_confidence}</h5>
                        <p className="text-muted">
                          Berdasarkan {employeeDetail.contract_recommendation.data_insights.sample_size} data serupa
                        </p>
                      </div>
                    </Card.Body>
                  </Card>
                </Col>
              </Row>

              {/* Reasoning */}
              <Card>
                <Card.Header style={{ backgroundColor: '#ffc107', color: 'black' }}>
                  <h6 className="mb-0">💡 Alasan Rekomendasi</h6>
                </Card.Header>
                <Card.Body>
                  <ul>
                    {employeeDetail.contract_recommendation.reasoning.map((reason, idx) => (
                      <li key={idx}>{reason}</li>
                    ))}
                  </ul>
                </Card.Body>
              </Card>
            </div>
          ) : (
            <Alert variant="danger">Gagal memuat detail karyawan</Alert>
          )}
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowEmployeeModal(false)}>
            Tutup
          </Button>
        </Modal.Footer>
      </Modal>
    </Container>
  );
};

export default ManagerDashboard;
